      assert.deepStrictEqual(metric!.timeseries, [
        {
          labelValues: [
            { value: '200' },
            { value: '400' },
            { value: 'localhost' },
          ],
          points: [
            {
              value: 200,
              timestamp: {
                nanos: mockedTime.nanos,
                seconds: mockedTime.seconds,
              },
            },
          ],
        },
      ]);
